apiVersion: v1
kind: ConfigMap
metadata:
  name: kubeconfig
data:
  config: |
    <apiVersion: v1
clusters:
- cluster:
    certificate-authority-data: 
    server: https://127.0.0.1:6443
  name: docker-desktop
- cluster:
    certificate-authority: /Users/abelonwu/.minikube/ca.crt
